import React from "react";

const List = ({ people }) => {
  return (
    <div>
      {people.map((person) => {
        const [id, name, image, age] = person;
        return (
          <article key={id}>
            <img src={image} alt={name} />
          </article>
        );
      })}
    </div>
  );
};

export default List;
